/**
 * @param {string} s
 * @return {string}
 */
const lastSubstring = function (s) {
  let lword = s;

  for (let i = 0, len = s.length; i < len; i++) {
    const ch = s[i];

    if (ch > lword[0]) {
      lword = s.substring(i);
    } else if (lword[0] === ch) {
      const newWord = s.substr(i, lword.length);
      if (newWord > lword) {
        lword = s.substring(i);
      }
    }
  }
  return lword;
};

console.time();
console.log(
  lastSubstring(
    ""
  )
);
console.timeEnd();
